INSERT INTO `lesson` (`LessonID`, `lessonNAME`, `tutorial`, `ClassID`) VALUES
(2, 'gh', 'Test Tube ROCKET’S \r\n\r\nAIM: The aim of this experiment is to investigate how well a model rocket made out of a test tube can fly\r\nHypothesis:\r\nExperiment 1: I predict that the Model rocket will have go straight up about 10 meters and spin vertically \r\n\r\nExperiment 2: due to the alteration to our groups rocket I predict the trajectory of the rocket will be straight up and will go twice has high in the air.\r\nEquipment:	Cardboard	Model rocket body (test tube)\r\n	Sticky tape	Hot glue stick\r\n	Hot glue gun	Rocket packet\r\n	Straw	Ruler\r\n	Scissors	Pen\r\n	White out	\r\n\r\nMethod\r\nRocket one\r\nStep 1 Design the rocket.\r\nStep 2 collected equipment.\r\nStep 3 heat up glue gun.\r\nStep 4 measure and mark out the wings on the car bored.\r\nStep 5 cut out the wings.\r\nStep 6 use the hot glue gun to glue the wings to the rock body.\r\nStep 7 cut the straw in half then glue it to the rocket. \r\nStep 8 load motor in the bottom of the hul.l\r\nStep 8 place rocket on stand.\r\nStep 9 lunch rocket.\r\n\r\n\r\n\r\nRocket two\r\nStep 1 sticky tape old wing back on. \r\nStep 2 trim down the wings.\r\nStep 3 load new rocket packet.\r\nStep 4 place rocket on stand.\r\nStep 5 lurch rocket.\r\n\r\nResults \r\nFirst rocket\r\nThe first launch did not go will with it only went up about 4 meter in the air snap. on its tip and span side wides and flew off  side wides and nearly hitting the crowed , when the rocket first hit the ground on of it wing brock off then it bounce then hit the ground again then  the second explosion went off and shot the rocket  1  meter away. \r\nSeconde rocket\r\nThe second launch went a lot better going over twice has high has the first launch going over 8 meters in the this went sight only on a small angel before falling back down then hitting the ground once then the after burn explosion going off and push the rocket into the ground. \r\n\r\nDictation\r\n The rocket did not go has high as predicted the first rocket only went 4-meter-high and not the 10 meters that was predicted and did not go straight it flew off to towards the crowed \r\nThe second rocket did go straight up like predicted but only half as high at 10 meters instead of it predicted high of 20 meters.\r\n\r\nConclusion \r\nIn conclusion we were able make a model rocket out of a test tube and launch it.\r\n', 15),
